import React from 'react';
import './App.css';
import { NeuCard, NeuHeading, NeuProgressBar, NeuReaction, NeuInput } from 'neumorphic-ui';

function App() {
  return (
    <div>
      <p>Hello World</p>
      <NeuCard height="300px" >
        <NeuHeading text="CADASTRO" />
        <form>
          <NeuInput placeholder="Nome" />
          <NeuInput placeholder="E-mail" />
          <NeuInput placeholder="Senha" />
          <NeuInput placeholder="Confirmar Senha" />
        </form>
      </NeuCard>
    </div>
  );
}

export default App;
